contracts/DIDRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title DIDRegistry
 * @dev Smart contract for managing Decentralized Identifiers (DIDs) on-chain
 * @notice This contract stores DID documents and provides resolution functionality
 */
contract DIDRegistry {
    struct DIDDocument {
        bytes publicKey;      // Ed25519 public key
        uint256 created;      // Creation timestamp
        uint256 updated;      // Last update timestamp
        bool active;          // Whether the DID is active
        address owner;        // Ethereum address that controls this DID
        string documentHash;  // IPFS hash of full DID document (optional)
    }

    // Mapping from DID string to DID document
    mapping(string => DIDDocument) public dids;

    // Mapping from owner address to list of owned DIDs
    mapping(address => string[]) public ownerDIDs;

    // Events
    event DIDRegistered(
        string indexed did, 
        address indexed owner, 
        bytes publicKey,
        uint256 timestamp
    );

    event DIDUpdated(
        string indexed did, 
        address indexed owner,
        bytes newPublicKey,
        uint256 timestamp
    );

    event DIDDeactivated(
        string indexed did, 
        address indexed owner,
        uint256 timestamp
    );

    event DIDTransferred(
        string indexed did,
        address indexed oldOwner,
        address indexed newOwner,
        uint256 timestamp
    );

    // Modifiers
    modifier onlyDIDOwner(string memory did) {
        require(dids[did].owner == msg.sender, "Not DID owner");
        require(dids[did].active, "DID is deactivated");
        _;
    }

    modifier validDID(string memory did) {
        require(bytes(did).length > 0, "Invalid DID");
        require(bytes(did).length <= 256, "DID too long");
        _;
    }

    /**
     * @dev Register a new DID
     * @param did The DID string (e.g., "did:key:z6MkhaXgBZDvotDkL5257faiztiGiC2QtKLGpbnnEGta2doK")
     * @param publicKey The Ed25519 public key bytes
     * @param documentHash Optional IPFS hash of the full DID document
     */
    function registerDID(
        string memory did,
        bytes memory publicKey,
        string memory documentHash
    ) external validDID(did) {
        require(!dids[did].active, "DID already exists");
        require(publicKey.length == 32, "Invalid public key length");

        dids[did] = DIDDocument({
            publicKey: publicKey,
            created: block.timestamp,
            updated: block.timestamp,
            active: true,
            owner: msg.sender,
            documentHash: documentHash
        });

        ownerDIDs[msg.sender].push(did);

        emit DIDRegistered(did, msg.sender, publicKey, block.timestamp);
    }

    /**
     * @dev Update a DID's public key
     * @param did The DID to update
     * @param newPublicKey The new Ed25519 public key
     * @param documentHash Optional new IPFS hash of the DID document
     */
    function updateDID(
        string memory did,
        bytes memory newPublicKey,
        string memory documentHash
    ) external onlyDIDOwner(did) {
        require(newPublicKey.length == 32, "Invalid public key length");

        dids[did].publicKey = newPublicKey;
        dids[did].updated = block.timestamp;
        dids[did].documentHash = documentHash;

        emit DIDUpdated(did, msg.sender, newPublicKey, block.timestamp);
    }

    /**
     * @dev Deactivate a DID (cannot be reactivated)
     * @param did The DID to deactivate
     */
    function deactivateDID(string memory did) external onlyDIDOwner(did) {
        dids[did].active = false;
        dids[did].updated = block.timestamp;

        emit DIDDeactivated(did, msg.sender, block.timestamp);
    }

    /**
     * @dev Transfer ownership of a DID to another address
     * @param did The DID to transfer
     * @param newOwner The new owner address
     */
    function transferDID(
        string memory did,
        address newOwner
    ) external onlyDIDOwner(did) {
        require(newOwner != address(0), "Invalid new owner");
        require(newOwner != msg.sender, "Already owner");

        address oldOwner = msg.sender;
        dids[did].owner = newOwner;
        dids[did].updated = block.timestamp;

        // Add to new owner's list
        ownerDIDs[newOwner].push(did);

        // Remove from old owner's list
        string[] storage oldOwnerDIDs = ownerDIDs[oldOwner];
        for (uint i = 0; i < oldOwnerDIDs.length; i++) {
            if (keccak256(bytes(oldOwnerDIDs[i])) == keccak256(bytes(did))) {
                oldOwnerDIDs[i] = oldOwnerDIDs[oldOwnerDIDs.length - 1];
                oldOwnerDIDs.pop();
                break;
            }
        }

        emit DIDTransferred(did, oldOwner, newOwner, block.timestamp);
    }

    /**
     * @dev Resolve a DID to get its document
     * @param did The DID to resolve
     * @return The DID document struct
     */
    function resolveDID(string memory did) 
        external 
        view 
        returns (DIDDocument memory) 
    {
        require(dids[did].active, "DID not found or deactivated");
        return dids[did];
    }

    /**
     * @dev Check if a DID exists and is active
     * @param did The DID to check
     * @return Whether the DID exists and is active
     */
    function didExists(string memory did) external view returns (bool) {
        return dids[did].active;
    }

    /**
     * @dev Get all DIDs owned by an address
     * @param owner The owner address
     * @return Array of DID strings
     */
    function getDIDsByOwner(address owner) 
        external 
        view 
        returns (string[] memory) 
    {
        return ownerDIDs[owner];
    }

    /**
     * @dev Get the number of DIDs owned by an address
     * @param owner The owner address
     * @return Number of DIDs
     */
    function getDIDCountByOwner(address owner) external view returns (uint256) {
        return ownerDIDs[owner].length;
    }

    /**
     * @dev Verify that a signature was created by the DID owner
     * @param did The DID that allegedly signed the message
     * @param messageHash The hash of the signed message
     * @param signature The Ed25519 signature (64 bytes)
     * @return Whether the signature is valid
     */
    function verifyDIDSignature(
        string memory did,
        bytes32 messageHash,
        bytes memory signature
    ) external view returns (bool) {
        require(dids[did].active, "DID not found or deactivated");
        require(signature.length == 64, "Invalid signature length");

        // Note: This is a placeholder. In practice, you'd need to implement
        // Ed25519 signature verification in Solidity, which is complex.
        // Consider using a precompiled contract or oracle for this.
        return true; // Placeholder
    }
}

contracts/RevocationRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title RevocationRegistry
 * @dev Smart contract for managing credential revocation lists on-chain
 * @notice This contract allows issuers to publish revocation lists and enables verification of credential status
 */
contract RevocationRegistry {
    struct RevocationList {
        uint256[] revokedCredentialIds;  // Array of revoked credential IDs (hashed)
        uint256 timestamp;               // When the list was published
        bytes signature;                 // Issuer's signature over the list
        uint256 version;                 // Version number for the list
        bytes32 merkleRoot;              // Merkle root for efficient revocation checks
    }

    // Mapping from issuer DID hash to their revocation list
    mapping(bytes32 => RevocationList) public revocationLists;

    // Mapping from issuer DID hash to authorized issuer status
    mapping(bytes32 => bool) public authorizedIssuers;

    // Mapping from issuer to their DID string (for events)
    mapping(bytes32 => string) public issuerDIDs;

    // Mapping for efficient revocation lookups: issuerHash => credentialHash => isRevoked
    mapping(bytes32 => mapping(bytes32 => bool)) public revokedCredentials;

    // Events
    event IssuerAuthorized(bytes32 indexed issuerHash, string issuerDID, uint256 timestamp);
    event IssuerDeauthorized(bytes32 indexed issuerHash, string issuerDID, uint256 timestamp);
    event RevocationListPublished(
        bytes32 indexed issuerHash, 
        string issuerDID,
        uint256 version,
        uint256 revokedCount,
        bytes32 merkleRoot,
        uint256 timestamp
    );
    event CredentialRevoked(
        bytes32 indexed issuerHash,
        bytes32 indexed credentialHash,
        string issuerDID,
        uint256 timestamp
    );

    // Access control
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Not contract owner");
        _;
    }

    modifier onlyAuthorizedIssuer(string memory issuerDID) {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        require(authorizedIssuers[issuerHash], "Not authorized issuer");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    /**
     * @dev Authorize an issuer to publish revocation lists
     * @param issuerDID The DID of the issuer to authorize
     */
    function authorizeIssuer(string memory issuerDID) external onlyOwner {
        require(bytes(issuerDID).length > 0, "Invalid issuer DID");

        bytes32 issuerHash = keccak256(bytes(issuerDID));
        authorizedIssuers[issuerHash] = true;
        issuerDIDs[issuerHash] = issuerDID;

        emit IssuerAuthorized(issuerHash, issuerDID, block.timestamp);
    }

    /**
     * @dev Deauthorize an issuer
     * @param issuerDID The DID of the issuer to deauthorize
     */
    function deauthorizeIssuer(string memory issuerDID) external onlyOwner {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        require(authorizedIssuers[issuerHash], "Issuer not authorized");

        authorizedIssuers[issuerHash] = false;

        emit IssuerDeauthorized(issuerHash, issuerDID, block.timestamp);
    }

    /**
     * @dev Publish a revocation list with individual credential hashes
     * @param issuerDID The DID of the issuer
     * @param credentialHashes Array of hashed credential IDs to revoke
     * @param signature Issuer's signature over the revocation data
     * @param merkleRoot Merkle root for efficient verification (optional, can be 0x0)
     */
    function publishRevocationList(
        string memory issuerDID,
        bytes32[] memory credentialHashes,
        bytes memory signature,
        bytes32 merkleRoot
    ) external onlyAuthorizedIssuer(issuerDID) {
        require(credentialHashes.length > 0, "Empty revocation list");
        require(signature.length > 0, "Invalid signature");

        bytes32 issuerHash = keccak256(bytes(issuerDID));

        // Convert bytes32 array to uint256 array for storage
        uint256[] memory revokedIds = new uint256[](credentialHashes.length);
        for (uint i = 0; i < credentialHashes.length; i++) {
            revokedIds[i] = uint256(credentialHashes[i]);
            // Mark individual credentials as revoked for quick lookup
            revokedCredentials[issuerHash][credentialHashes[i]] = true;

            emit CredentialRevoked(issuerHash, credentialHashes[i], issuerDID, block.timestamp);
        }

        // Increment version
        uint256 newVersion = revocationLists[issuerHash].version + 1;

        // Store the revocation list
        revocationLists[issuerHash] = RevocationList({
            revokedCredentialIds: revokedIds,
            timestamp: block.timestamp,
            signature: signature,
            version: newVersion,
            merkleRoot: merkleRoot
        });

        emit RevocationListPublished(
            issuerHash,
            issuerDID,
            newVersion,
            credentialHashes.length,
            merkleRoot,
            block.timestamp
        );
    }

    /**
     * @dev Add individual credentials to the revocation list
     * @param issuerDID The DID of the issuer
     * @param credentialHashes Array of credential hashes to revoke
     * @param signature New signature covering the updated list
     */
    function revokeCredentials(
        string memory issuerDID,
        bytes32[] memory credentialHashes,
        bytes memory signature
    ) external onlyAuthorizedIssuer(issuerDID) {
        require(credentialHashes.length > 0, "No credentials to revoke");

        bytes32 issuerHash = keccak256(bytes(issuerDID));

        // Mark credentials as revoked
        for (uint i = 0; i < credentialHashes.length; i++) {
            if (!revokedCredentials[issuerHash][credentialHashes[i]]) {
                revokedCredentials[issuerHash][credentialHashes[i]] = true;

                // Add to the stored list
                revocationLists[issuerHash].revokedCredentialIds.push(uint256(credentialHashes[i]));

                emit CredentialRevoked(issuerHash, credentialHashes[i], issuerDID, block.timestamp);
            }
        }

        // Update metadata
        revocationLists[issuerHash].timestamp = block.timestamp;
        revocationLists[issuerHash].signature = signature;
        revocationLists[issuerHash].version += 1;

        emit RevocationListPublished(
            issuerHash,
            issuerDID,
            revocationLists[issuerHash].version,
            credentialHashes.length,
            revocationLists[issuerHash].merkleRoot,
            block.timestamp
        );
    }

    /**
     * @dev Check if a credential is revoked
     * @param issuerDID The DID of the issuer
     * @param credentialId The credential ID to check
     * @return Whether the credential is revoked
     */
    function isCredentialRevoked(
        string memory issuerDID,
        string memory credentialId
    ) external view returns (bool) {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        bytes32 credentialHash = keccak256(bytes(credentialId));

        return revokedCredentials[issuerHash][credentialHash];
    }

    /**
     * @dev Check if a credential is revoked using hashes (more efficient)
     * @param issuerHash Hash of the issuer DID
     * @param credentialHash Hash of the credential ID
     * @return Whether the credential is revoked
     */
    function isCredentialRevokedByHash(
        bytes32 issuerHash,
        bytes32 credentialHash
    ) external view returns (bool) {
        return revokedCredentials[issuerHash][credentialHash];
    }

    /**
     * @dev Get the revocation list for an issuer
     * @param issuerDID The DID of the issuer
     * @return The revocation list struct
     */
    function getRevocationList(string memory issuerDID) 
        external 
        view 
        returns (RevocationList memory) 
    {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        return revocationLists[issuerHash];
    }

    /**
     * @dev Get the number of revoked credentials for an issuer
     * @param issuerDID The DID of the issuer
     * @return Number of revoked credentials
     */
    function getRevokedCredentialCount(string memory issuerDID) 
        external 
        view 
        returns (uint256) 
    {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        return revocationLists[issuerHash].revokedCredentialIds.length;
    }

    /**
     * @dev Verify a Merkle proof for credential revocation
     * @param issuerDID The DID of the issuer
     * @param credentialHash The hash of the credential to verify
     * @param merkleProof Array of hashes forming the Merkle proof
     * @return Whether the credential is in the revocation list
     */
    function verifyRevocationProof(
        string memory issuerDID,
        bytes32 credentialHash,
        bytes32[] memory merkleProof
    ) external view returns (bool) {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        bytes32 merkleRoot = revocationLists[issuerHash].merkleRoot;

        if (merkleRoot == bytes32(0)) {
            // No Merkle tree, fall back to direct lookup
            return revokedCredentials[issuerHash][credentialHash];
        }

        return _verifyMerkleProof(merkleProof, merkleRoot, credentialHash);
    }

    /**
     * @dev Internal function to verify Merkle proof
     * @param proof Array of sibling hashes
     * @param root The Merkle root
     * @param leaf The leaf to verify
     * @return Whether the proof is valid
     */
    function _verifyMerkleProof(
        bytes32[] memory proof,
        bytes32 root,
        bytes32 leaf
    ) internal pure returns (bool) {
        bytes32 computedHash = leaf;

        for (uint256 i = 0; i < proof.length; i++) {
            bytes32 proofElement = proof[i];

            if (computedHash <= proofElement) {
                computedHash = keccak256(abi.encodePacked(computedHash, proofElement));
            } else {
                computedHash = keccak256(abi.encodePacked(proofElement, computedHash));
            }
        }

        return computedHash == root;
    }

    /**
     * @dev Transfer ownership of the contract
     * @param newOwner The new owner address
     */
    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "Invalid new owner");
        owner = newOwner;
    }
}

contracts/SchemaRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title SchemaRegistry
 * @dev Smart contract for managing credential schemas on-chain
 * @notice This contract allows registration and management of verifiable credential schemas
 */
contract SchemaRegistry {
    struct CredentialSchema {
        string name;              // Human-readable name
        string description;       // Schema description
        string schemaHash;        // IPFS hash of the full JSON schema
        string issuerDID;         // DID of the schema creator
        string version;           // Schema version (e.g., "1.0.0")
        uint256 created;          // Creation timestamp
        uint256 updated;          // Last update timestamp
        bool active;              // Whether the schema is active
        address owner;            // Ethereum address that owns this schema
        SchemaType schemaType;    // Type of schema
        string[] dependencies;    // Other schema IDs this schema depends on
    }

    enum SchemaType {
        BasicProfile,     // Basic user profile information
        Educational,      // Educational credentials
        Professional,     // Professional certifications
        Medical,          // Medical records
        Financial,        // Financial information
        Identity,         // Identity verification
        Custom           // Custom schema type
    }

    // Mapping from schema ID to schema
    mapping(uint256 => CredentialSchema) public schemas;

    // Mapping from issuer DID hash to their schema IDs
    mapping(bytes32 => uint256[]) public issuerSchemas;

    // Mapping from schema name hash to schema ID (for name uniqueness per issuer)
    mapping(bytes32 => mapping(bytes32 => uint256)) public schemaNameToId;

    // Counter for schema IDs
    uint256 private nextSchemaId = 1;

    // Events
    event SchemaRegistered(
        uint256 indexed schemaId,
        string indexed issuerDID,
        string name,
        string version,
        SchemaType schemaType,
        uint256 timestamp
    );

    event SchemaUpdated(
        uint256 indexed schemaId,
        string indexed issuerDID,
        string newVersion,
        uint256 timestamp
    );

    event SchemaDeactivated(
        uint256 indexed schemaId,
        string indexed issuerDID,
        uint256 timestamp
    );

    event SchemaTransferred(
        uint256 indexed schemaId,
        string issuerDID,
        address indexed oldOwner,
        address indexed newOwner,
        uint256 timestamp
    );

    // Modifiers
    modifier onlySchemaOwner(uint256 schemaId) {
        require(schemas[schemaId].owner == msg.sender, "Not schema owner");
        require(schemas[schemaId].active, "Schema is deactivated");
        _;
    }

    modifier validSchemaId(uint256 schemaId) {
        require(schemaId > 0 && schemaId < nextSchemaId, "Invalid schema ID");
        _;
    }

    /**
     * @dev Register a new credential schema
     * @param name Human-readable name for the schema
     * @param description Description of the schema
     * @param schemaHash IPFS hash of the full JSON schema
     * @param issuerDID DID of the schema creator
     * @param version Version string (e.g., "1.0.0")
     * @param schemaType Type of the schema
     * @param dependencies Array of schema IDs this schema depends on
     * @return The ID of the newly registered schema
     */
    function registerSchema(
        string memory name,
        string memory description,
        string memory schemaHash,
        string memory issuerDID,
        string memory version,
        SchemaType schemaType,
        string[] memory dependencies
    ) external returns (uint256) {
        require(bytes(name).length > 0, "Schema name required");
        require(bytes(schemaHash).length > 0, "Schema hash required");
        require(bytes(issuerDID).length > 0, "Issuer DID required");
        require(bytes(version).length > 0, "Version required");

        bytes32 issuerHash = keccak256(bytes(issuerDID));
        bytes32 nameHash = keccak256(bytes(name));

        // Check if schema name already exists for this issuer
        require(
            schemaNameToId[issuerHash][nameHash] == 0, 
            "Schema name already exists for this issuer"
        );

        // Validate dependencies exist
        for (uint i = 0; i < dependencies.length; i++) {
            uint256 depId = _stringToUint(dependencies[i]);
            require(depId > 0 && depId < nextSchemaId, "Invalid dependency");
            require(schemas[depId].active, "Dependency schema not active");
        }

        uint256 schemaId = nextSchemaId++;

        schemas[schemaId] = CredentialSchema({
            name: name,
            description: description,
            schemaHash: schemaHash,
            issuerDID: issuerDID,
            version: version,
            created: block.timestamp,
            updated: block.timestamp,
            active: true,
            owner: msg.sender,
            schemaType: schemaType,
            dependencies: dependencies
        });

        issuerSchemas[issuerHash].push(schemaId);
        schemaNameToId[issuerHash][nameHash] = schemaId;

        emit SchemaRegistered(
            schemaId,
            issuerDID,
            name,
            version,
            schemaType,
            block.timestamp
        );

        return schemaId;
    }

    /**
     * @dev Update an existing schema
     * @param schemaId The ID of the schema to update
     * @param description New description
     * @param schemaHash New IPFS hash of the schema
     * @param newVersion New version string
     * @param dependencies New dependencies array
     */
    function updateSchema(
        uint256 schemaId,
        string memory description,
        string memory schemaHash,
        string memory newVersion,
        string[] memory dependencies
    ) external validSchemaId(schemaId) onlySchemaOwner(schemaId) {
        require(bytes(schemaHash).length > 0, "Schema hash required");
        require(bytes(newVersion).length > 0, "Version required");

        // Validate dependencies
        for (uint i = 0; i < dependencies.length; i++) {
            uint256 depId = _stringToUint(dependencies[i]);
            require(depId > 0 && depId < nextSchemaId, "Invalid dependency");
            require(schemas[depId].active, "Dependency schema not active");
        }

        schemas[schemaId].description = description;
        schemas[schemaId].schemaHash = schemaHash;
        schemas[schemaId].version = newVersion;
        schemas[schemaId].updated = block.timestamp;
        schemas[schemaId].dependencies = dependencies;

        emit SchemaUpdated(
            schemaId,
            schemas[schemaId].issuerDID,
            newVersion,
            block.timestamp
        );
    }

    /**
     * @dev Deactivate a schema
     * @param schemaId The ID of the schema to deactivate
     */
    function deactivateSchema(uint256 schemaId) 
        external 
        validSchemaId(schemaId) 
        onlySchemaOwner(schemaId) 
    {
        schemas[schemaId].active = false;
        schemas[schemaId].updated = block.timestamp;

        emit SchemaDeactivated(
            schemaId,
            schemas[schemaId].issuerDID,
            block.timestamp
        );
    }

    /**
     * @dev Transfer ownership of a schema
     * @param schemaId The ID of the schema to transfer
     * @param newOwner The new owner address
     */
    function transferSchema(
        uint256 schemaId,
        address newOwner
    ) external validSchemaId(schemaId) onlySchemaOwner(schemaId) {
        require(newOwner != address(0), "Invalid new owner");
        require(newOwner != msg.sender, "Already owner");

        address oldOwner = msg.sender;
        schemas[schemaId].owner = newOwner;
        schemas[schemaId].updated = block.timestamp;

        emit SchemaTransferred(
            schemaId,
            schemas[schemaId].issuerDID,
            oldOwner,
            newOwner,
            block.timestamp
        );
    }

    /**
     * @dev Get a schema by ID
     * @param schemaId The schema ID
     * @return The schema struct
     */
    function getSchema(uint256 schemaId) 
        external 
        view 
        validSchemaId(schemaId)
        returns (CredentialSchema memory) 
    {
        return schemas[schemaId];
    }

    /**
     * @dev Get all schemas for an issuer
     * @param issuerDID The issuer DID
     * @return Array of schema IDs
     */
    function getSchemasByIssuer(string memory issuerDID) 
        external 
        view 
        returns (uint256[] memory) 
    {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        return issuerSchemas[issuerHash];
    }

    /**
     * @dev Get schema ID by issuer and name
     * @param issuerDID The issuer DID
     * @param name The schema name
     * @return The schema ID (0 if not found)
     */
    function getSchemaIdByName(
        string memory issuerDID,
        string memory name
    ) external view returns (uint256) {
        bytes32 issuerHash = keccak256(bytes(issuerDID));
        bytes32 nameHash = keccak256(bytes(name));
        return schemaNameToId[issuerHash][nameHash];
    }

    /**
     * @dev Get schemas by type
     * @param schemaType The type of schemas to retrieve
     * @return Array of schema IDs
     */
    function getSchemasByType(SchemaType schemaType) 
        external 
        view 
        returns (uint256[] memory) 
    {
        // Count matching schemas first
        uint256 count = 0;
        for (uint256 i = 1; i < nextSchemaId; i++) {
            if (schemas[i].active && schemas[i].schemaType == schemaType) {
                count++;
            }
        }

        // Create result array
        uint256[] memory result = new uint256[](count);
        uint256 index = 0;

        for (uint256 i = 1; i < nextSchemaId; i++) {
            if (schemas[i].active && schemas[i].schemaType == schemaType) {
                result[index] = i;
                index++;
            }
        }

        return result;
    }

    /**
     * @dev Check if a schema exists and is active
     * @param schemaId The schema ID to check
     * @return Whether the schema exists and is active
     */
    function schemaExists(uint256 schemaId) external view returns (bool) {
        return schemaId > 0 && schemaId < nextSchemaId && schemas[schemaId].active;
    }

    /**
     * @dev Get the total number of schemas registered
     * @return The total schema count
     */
    function getTotalSchemaCount() external view returns (uint256) {
        return nextSchemaId - 1;
    }

    /**
     * @dev Get schema dependencies
     * @param schemaId The schema ID
     * @return Array of dependency schema IDs as strings
     */
    function getSchemaDependencies(uint256 schemaId) 
        external 
        view 
        validSchemaId(schemaId)
        returns (string[] memory) 
    {
        return schemas[schemaId].dependencies;
    }

    /**
     * @dev Check if schema has circular dependencies
     * @param schemaId The schema ID to check
     * @return Whether the schema has circular dependencies
